import React from 'react';
import { Menu, Icon, Input, Typography } from 'antd';

const { Title, Paragraph, Text } = Typography;
const { Search } = Input;

const AppTopbar = () => {
    return(
        <div>
          <Menu mode="horizontal">
            <Menu.Item key="mail">
                <Icon type="home" style={{ fontSize: '30px'}} />
            </Menu.Item>
            <Menu.Item key="search">
                <Search
                    placeholder="input search text"
                    enterButton="Search"
                    size="small"
                /> 
            </Menu.Item>
            <Menu.Item key="subject">
                <Typography>
                    <Title>RemindFeedBack</Title>
                </Typography>
            </Menu.Item>
            <Menu.Item key="bell">
                <Icon type="bell style={{ fontSize: '30px'}}" />
            </Menu.Item>
          </Menu>  
        </div>
    );
};

export default AppTopbar;
